import React from 'react'
import { Col, Container, Row } from 'react-bootstrap';

const Footer = () => {
    return (
        <div>
            <Container>
                <Row className="text-center">
                    <Col>
                        Copyright &copy; SJ's SHOP
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Footer
